  false,\n\t\"url\": null,\n\t\"notes\": \"The original topographic maps containing
  the drawn delta border were scanned from the Department of Water Resources. Images
  were registered to 1:24,000 USGS DRG's in ArcView (ESRI) utilizing imagewarp extension.
  The Delta boundary was digitized from the registered images. Accuracy within acceptable
  7.5 Minute USGS map accuracy standards (1:24000 scale). Delta boundary version 2002.4.
  The original legal boundary maps obtained from the Delta Protection Commission were
  compiled by DWR Land & Right of Way sometime in the early 1980's. They were based
  from the legal description in section 12220 of the Water Code, with ambiguities
  in the Code addressed by the individuals involved in the mapping project at that
  time. One revision was made to the original maps in the vicinity of Point Pleasant,
  and is the only difference between this and the 4.2001 version of the legal Delta
  boundary Arc/INFO coverage.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
